import { useEffect, useState } from 'react';
import { useAuth } from './context/AuthContext'
import { useNavigate } from 'react-router-dom';
import  axios  from 'axios'
function Home() {
  const [movies, setMovies]=useState([]);
  useEffect(()=>{
    axios
    .get("http://localhost:8081/movies")
    .then((res)=>{   
          setMovies(res.data)
       
      }
    )
  },[]);
    console.log(movies);

    const navigate = useNavigate();;
    const { user, logout } = useAuth();
    const handleLogOut = () =>{
        logout();
        navigate("/")
    }
  return (
    <div className='relative min-h-screen bg-black text-white'>Welcome
        <header className='fixed top-0 h-[90px] w-full bg-white'>
          <nav className='text-red-600 font-bold'>
            <div>
              <ol>PELISUNCP</ol>
              <li>Bienvenido, {user?.name}</li>
              <li><button className='bg-red-600 text-white px-4 py-2 rounded' onClick={handleLogOut}>SALIR</button></li>
            </div>
          </nav>
        </header>
        <h1>{user?.name}</h1>
        <p>{user?.role}</p>
        {user?.role ==="administrador" && <button className='absolute top-0 right-0 px-4 py-2 rounded bg-blue-500'>Añadir película</button>}
        
        <div>{movies[0]?.title}</div>
        <div>{movies[0]?.id}</div>
        <div>{movies[0]?.description}</div>
    </div>
  )
}

export default Home
